import React from 'react';

const EventCard = ({ event }) => {
  return (
    <div className="flex border-b py-4">
      <div className="w-1/6 flex flex-col items-center bg-green-900 text-white py-2">
        <span className="text-3xl">{event.date}</span>
        <span className="uppercase">{event.month}</span>
      </div>
      <div className="w-4/6 px-4 flex flex-col justify-center">
        <div className="text-lg font-semibold">{event.eventName}</div>
        <div className="text-sm">{event.host}</div>
        <div className="text-xs text-gray-500">{event.location}</div>
        <div className="text-xs mt-2">{event.duration}</div>
        <div className="text-xs">{event.startTime} - {event.endTime} ({event.timezone})</div>
      </div>
      <div className="w-1/6 flex flex-col items-center justify-center bg-blue-500 text-white">
        <span className="text-sm">{event.cost}</span>
        <button className="bg-blue-700 py-1 px-4 mt-2">View Event</button>
      </div>
    </div>
  );
};

export default EventCard;
